import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import Header from './Header';
import UndergradCoursework from './UndergradCoursework';
import Projects from './Projects';
import Articles from './Articles';
import Misc from './Misc';
import Home from './Home';

const App = () => {
    return (
        <div className="ui inverted segment" style={{ backgroundColor: 'black' }}>
            <div className="ui container">
                <BrowserRouter>
                    <div>
                        <Header />
                        <Route path="/" exact component={Home} />
                        <Route path="/undergrad" exact component={UndergradCoursework} />
                        <Route path="/projects" exact component={Projects} />
                        <Route path="/articles" exact component={Articles} />
                        <Route path="/misc" exact component={Misc} />
                        <div className="ui inverted segment">
                            <img className="ui fluid image" src="/programming.jpeg" />
                        </div>
                    </div>
                </BrowserRouter>
            </div>
        </div>    
    );
};

export default App;
